description:
Science-Fiction
180 minuten (miniserie, 2 delen)

goed

met Benjamin Bratt, Eric McCormack en Christa Miller

Een Amerikaanse militaire satelliet crasht in een klein plaatsje en veroorzaakt een dodelijke plaag, slechts overleefd door 
twee personen. Het leger plaatst het gebied in quarantaine en zendt een team van wetenschappers naar het gebied om een tegengif 
te vinden voor het Andromeda virus. Ondertussen onderzoekt een journalist deze zaak die door de overheid in de doofpot wordt 
gestopt.
